export function clientsContentDataSuccess(clients) {
    return {
        type: "CLIENTS_CONTENT_DATA_SUCCESS",
        payload: clients
    }
}

export const clientsContentData = (url) => dispatch => {
    fetch(url)
        .then(
            response => {
                if (!response.ok) {
                    throw new Error(response.statusText)
                }
                return response
            })
        .then(response => response.json())
        .then(clients => dispatch(clientsContentDataSuccess(clients)))
}
